export const updateForm = (newForm) => {
    console.log('ACTION UPDATE: ', newForm)
    return {
        type: 'UPDATE_FORM',
        form: newForm
    };
};

export const clearForm = () => {
    return {
        type: 'CLEAR_FORM',
    }
}
